@import './reset.scss';
@import '../../node_modules/hamburgers/_sass/hamburgers/hamburgers.scss';
@import '../sass/fonts.scss';

.hamburger-inner, .hamburger-inner::before, .hamburger-inner::after {
    width: 30px;
    height: 3px;
    // background-color: #7a00aa;
}
.swiped {
    left: 20px !important;
}

// .hamburger.is-active .hamburger-inner, .hamburger.is-active .hamburger-inner::before, .hamburger.is-active .hamburger-inner::after {
//     background-color: #7a00aa;
// }

.hamburger-inner {
    transform: translate(-13px, -10px);
    transition-duration: 1s;
}

.hamburger:active {
    outline: none;
}

.swiper-container {
    width: 70%;
    height: 650px;
    border: 1px solid #cdcdcd;
    border-radius: 10px;
    display: flex;
    box-shadow: 0px 0px 22px -16px rgba(0,0,0,0.75);
    margin-bottom: 30px;
}

.swiper-slide {
    display: flex;
    height: 100%;
}

.swiper-container-horizontal>.swiper-pagination-bullets, .swiper-pagination-custom, .swiper-pagination-fraction {
    bottom: 35px;
    color: #7a00aa;
};

.swiper-button-next, .swiper-button-prev {
    color: #7a00aa;
}

.swiper-pagination-bullet-active {
    background: #7a00aa;
}





// Header section

.header {
    position: relative;
    padding: 30px 45px 20px;
    text-align: center;
    background-position: 100% 100%;
    background: linear-gradient(rgba(252, 241, 255, .9),rgba(252, 241, 255, .9)), url(../images/header-sec_img.jpg) no-repeat center center fixed;
    background-size: cover;
    border-bottom: 1px solid #424242;
}

.header__top {
    padding-bottom: 200px;
}

.header__title {
    font-size: 34px;
    font-family: 'Montserrat-Medium', sans-serif;
    position: relative;
    padding-bottom: 10px; 
    margin-bottom: 40px;
    text-transform: uppercase;
    color: #7a00aa;
}

.header__welcome__message {
    font-size: 28px;
    font-family: 'Montserrat-Light', sans-serif;
    font-weight: 300;
